import "./App.css";
import AppRoutes from "./AppRoutes/AppRoutes";
import NavBarContainer from "./NavBar/NavBarContainer/NavBarContainer";
import { useAuth0 } from "@auth0/auth0-react";

function App() {
  const { isLoading } = useAuth0();

  if (isLoading) {
    return <Loading />;
  }
  return (
    <>
      <NavBarContainer />
      <AppRoutes />
    </>
  );
}

export default App;
